class Move ():
    def __init__ (self, name:str, x:int, y:int, color:int, stone_id:int, coords:list ):
        self.name = name
        self.x = x
        self.y = y
        self.color = color 
        self.stone_id = stone_id
        self.coords = coords
        self.score = None
        self.score_tab = None
        self.free = 1
    
